import React, { Component } from 'react';
import Button from 'react';

class Counter extends React.Component {
    render(){
        {this.formatCount()}<div>
        <Button shape="round" onClick={this.handleIncrement}>Increment</Button>
        <Button shape="round" onClick={this.handleDecrement}>Decrement</Button>
        </div>
        return <div><h1>你好</h1></div>;
    }
}
export default Counter;
